select 11 as TenantID, OrganizationGuid, FullName as OrganizationName, ShortName as OrganizationShortName, o.IsActive, [URL] as OrganizationUrl, aao.OrganizationTypeID
from Keystone.dbo.Organization o
join ActionAgendaOrgs aao on o.FullName = aao.OrganizationName
where o.AuditEventIDCreate = '36045D30-D5AD-42F6-A7D2-17778C15AE55'

